import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
  <body id="body" class="bg-gray-100 text-gray-900">
    <App />
  </body>
  </React.StrictMode>
);

reportWebVitals();
